import React from 'react';
//import logo from './logo.svg';
import './App.css';

import Converter from './components/Converter'

function App() {

  const url = `https://free.currconv.com/api/v7/currencies?apiKey=a711cb5507804a084d63`;

  let currencies = {}

  fetch(url).then(res=>{
    return res.json();
  }).then(json => {
    currencies = json["results"];
    console.log(currencies);
  })

  return (
    <div className="App">

      <Converter currencyMain="USD" currencyConverted="BRL"></Converter>

    </div>
  );
}

export default App;
